import React from "react";
import { Box } from "@mui/system";
import CancelOutlinedIcon from "@mui/icons-material/CancelOutlined";

export default function App(props) {
  return (
    <Box sx={{ backgroundColor: "#0B0B0C", height: "100vh" }}>
      <Box p={10}>
        <CancelOutlinedIcon />
      </Box>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          color: "#EAEBF1",
          lineHeight: "36px",
          fontSize: "24px",
          fontWeight: "600",
          paddingTop: "50%",
          backgroundColor: "#0B0B0C",
        }}
      >
        <img
          style={{ height: "120px", width: "auto" }}
          src={require("../../assets/img/fail.png")}
          alt="fail"
        />

        <p style={{ marginTop: "50px" }}>대여 실패</p>
        <p
          onClick={() => {
            window.open("https://pf.kakao.com/_eWuNT/chat", "_blank");
          }}
          style={{
            marginTop: "12px",
            textAlign: "center",
            fontFamily: "Noto Sans KR",
            fontStyle: "normal",
            fontWeight: "normal",
            fontSize: "16px",
            lineHeight: "21px",
            /* identical to box height */

            textAlign: "center",
            textDecorationLine: "underline",

            /* Light */

            color: "#EAEBF1",
          }}
        >
          카카오 고객센터 연결
        </p>
      </div>
    </Box>
  );
}
